import { Star, Calendar } from 'lucide-react';

const HomeDoctorSection = ({ doctors }) => {
  if (!doctors || doctors.length === 0) {
    return (
      <section>
        <h2 className="text-2xl font-bold mb-6">Bác sĩ nổi bật</h2>
        <div className="text-slate-500 italic">
          Chưa có dữ liệu bác sĩ
        </div>
      </section>
    );
  }

  return (
    <section>
      <h2 className="text-2xl font-bold mb-6">Bác sĩ nổi bật</h2>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
        {doctors.map(doc => (
          <div
            key={doc.id}
            className="bg-white p-6 rounded-2xl shadow-sm border border-slate-100 text-center"
          >
            <h3 className="font-bold">{doc.name}</h3>
            <p className="text-sm text-blue-600">{doc.specialtyName}</p>

            <div className="flex justify-center items-center gap-1 my-2">
              <Star size={16} />
              <span>{doc.rating}</span>
            </div>

            <button className="bg-blue-600 text-white px-4 py-2 rounded">
              <Calendar size={16} className="inline mr-1" />
              Đặt lịch khám
            </button>
          </div>
        ))}
      </div>
    </section>
  );
};

export default HomeDoctorSection;
